import React from "react";

const ContactList = (props) => {
  return (
    <table>
      <tbody>
        <tr>
          <th>Name</th>
          <th>Phone</th>
          <th>Email</th>
        </tr>
        {props.contacts.map((contact) => {
          return (
            <tr key={contact.id}>
              <th>{contact.name}</th>
              <th>{contact.phone}</th>
              <th>{contact.email}</th>
            </tr>
          );
        })}
      </tbody>
    </table>
  );
};

export default ContactList;
